import React from "react";
import Friend from "./Friend/Friend";

const Friends = (props) => {
    let friendsElements = props.state.friends.map((friend) => {
        return (
            <Friend friend={friend.name} id={friend.id}/>
        )
    })

    return (
        {friendsElements}
    )
}

export default Friends;
